import React from 'react'
import { Box,Grid, Typography } from '@mui/material'


const About = () => {
    return (
        <Box>
            <Typography variant="h4" color="inherit" component="div" sx={{

                margin: 5
            }}>
                About
            </Typography>
            <Grid >






                <Grid container justify="center" justifyContent="" sx={{
                    marginTop: 4
                }}>
                    <Grid item xs={3} sm={3} ml={10}>
                        <img src="https://i.imgur.com/jinyH31.jpg/" alt="" height="400px" width="300px" />
                    </Grid>

                    <Grid item xs={3} sm={3} mt = {5}>
                        <Typography width={800} variant="body1" color="inherit" component="div" sx={{

                            margin: 2
                        }}>

                            <div></div>

                            My love for mobile development began years ago when I developed my first Android app. Since then, I've had the privilege of working on a variety of mobile projects, each of which has helped me grow as a developer. My expertise in Java and Kotlin has allowed me to create seamless and user-friendly apps, while my proficiency in C++ has enabled me to develop robust and high-performance mobile applications.

                            Overall, I'm a dedicated and hardworking developer who is always looking for new challenges and opportunities to grow. I'm excited about what the future holds and can't wait to see where my skills will take me next.
                        </Typography>
                    </Grid>





                </Grid>
            </Grid>


        </Box>
    )
}

export default About
